import React from "react";
import SearchResults from "./SearchResults";
import { useState } from "react";

const Main = props => {
  const [state, setState] = useState({
    searchResults: {
      data: []
    }
  });
  return (
    <div className="container">
      <SearchResults />
    </div>
  );
};

export default Main;
